import React from 'react';
import Link from "next/link";


class Navbar extends React.Component {


  render() {
    return (
      <div>
        <nav className="navbar navbar-expand-lg navbar-dark bg-dark fig-top">
          <a className="navbar-brand" href="#">Navbar</a>
          <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarNavAltMarkup" aria-controls="navbarNavAltMarkup" aria-expanded="false" aria-label="Toggle navigation">
            <span className="navbar-toggler-icon"></span>
          </button>
          <div className="collapse navbar-collapse" id="navbarNavAltMarkup">
            <div className="navbar-nav">
              <ul className="list-inline">
                <li className="list-inline-item title"><Link href="/">หน้าหลัก</Link></li>
                <li className="list-inline-item title">|</li>
                <li className="list-inline-item title"><Link href="/about">เกี่ยวกับเรา</Link></li>
              </ul>
              {/* <li className="nav-item nav-link active" href="#">Home <span className="sr-only">(current)</span></li>
              <li className="nav-item nav-link disabled"><Link href="/">หน้าหลัก</Link></li>
              <li className="nav-item nav-link disabled"><Link href="/about">เกี่ยวกับเรา</Link></li>
              <li className="nav-item nav-link disabled" href="#" tabindex="-1" aria-disabled="true">Disabled</li> */}
            </div>
          </div>
        </nav>
      </div>
    );
  }
}

export default Navbar;
